import React, { useState, useEffect } from 'react';
import { fetchSavedUserData, updateUserSettings, updateUserPreferences } from '../services/api';
import { useNavigate } from 'react-router-dom';

function ProfilePage() {
  const [formData, setFormData] = useState({
    weight: '',
    height: '',
    age: '',
    gender: '',
    favoriteFoods: '',
    dislikedFoods: '',
    typeOfWorkout: '',
    days: '',
  });

  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      setMessage('Please log in.');
      return;
    }

    setLoading(true);
    fetchSavedUserData(token)
      .then((data) => {
        if (data) {
          setFormData((prev) => ({ ...prev, ...data }));
        }
      })
      .catch(() => {
        setMessage('Could not fetch user settings.');
      })
      .finally(() => setLoading(false));
  }, []);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem('token');
    if (!token) {
      setMessage('Please log in.');
      return;
    }

    setLoading(true);

    // ✅ Send request to /users/settings
    await updateUserSettings(token, { username: formData.username });

    // ✅ Send request to /preferences
    await updateUserPreferences(token, {
      weight: formData.weight,
      height: formData.height,
      age: formData.age,
      gender: formData.gender,
      favoriteFoods: formData.favoriteFoods,
      dislikedFoods: formData.dislikedFoods,
      typeOfWorkout: formData.typeOfWorkout,
      days: formData.days,
    });

    setLoading(false);
    setMessage('Profile updated successfully!');
  };

  return (
    <div style={{ padding: '2rem' }}>
      <h2>Profile Settings</h2>

      {loading && <p>Loading...</p>}
      {message && <p>{message}</p>}

      <form onSubmit={handleSubmit}>
        <div>
          <label>Weight:</label>
          <input type="text" name="weight" value={formData.weight} onChange={handleChange} />
        </div>
        <div>
          <label>Height:</label>
          <input type="text" name="height" value={formData.height} onChange={handleChange} />
        </div>
        <div>
          <label>Age:</label>
          <input type="text" name="age" value={formData.age} onChange={handleChange} />
        </div>
        <div>
          <label>Gender:</label>
          <input type="text" name="gender" value={formData.gender} onChange={handleChange} />
        </div>
        <div>
          <label>Favorite Foods:</label>
          <input type="text" name="favoriteFoods" value={formData.favoriteFoods} onChange={handleChange} />
        </div>
        <div>
          <label>Disliked Foods:</label>
          <input type="text" name="dislikedFoods" value={formData.dislikedFoods} onChange={handleChange} />
        </div>
        <div>
          <label>Type of Workout:</label>
          <input type="text" name="typeOfWorkout" value={formData.typeOfWorkout} onChange={handleChange} />
        </div>
        <div>
          <label>Days:</label>
          <input type="text" name="days" value={formData.days} onChange={handleChange} />
        </div>
        <button type="submit" style={{ marginTop: '1rem' }}>Save Profile</button>
      </form>
    </div>
  );
}

export default ProfilePage;
